import React from 'react';

function Search() {
    return (
        <div className="app-header">
            <h1 className="logo">Trip Planner</h1>
            <form className="searchbar">
                <input type="text" name="searchbar" placeholder="Search for a place"></input>
            </form>
        </div>
    )
}

export default Search;
